import React from "react";
import { Card } from "react-bootstrap";

const CardUser = (props) => {
    return (
        <div>
            <Card id="Review" style={{ width: '18rem' }}>
                <Card.Body>User1</Card.Body>
            </Card>
        </div>
    )
}

export default CardUser;
